// export default Sidebar
import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Sidebar() {
  const [showVenteLinks, setShowVenteLinks] = useState(false);

  const toggleVenteLinks = () => {
    setShowVenteLinks(!showVenteLinks);
  };

  return (
    <div className='bg-white'>
      <div className='m-2'>
        <i className='bi bi-bootstrap-fill me-2 fs-4'></i>
        <span className='brand-name fs-4'>Quincaillerie</span>
      </div>
      <hr className='text-dark' />
      <div className='list-group list-group-flush'>
        <a className='list-group-item py-2 '>
          <i className='bi bi-speedometer2 fs-5 me-2'></i>
          <Link to="/fournisseur" className="text-decoration-none">Fournisseurs</Link>
        </a>
        <a className='list-group-item py-2'>
          <i className='bi bi-house fs-4 me-2'></i>
          <Link to="/client" className="text-decoration-none">Clients</Link>
        </a>
        <a className='list-group-item py-2'>
          <i className='bi bi-house fs-4 me-2'></i>
          <Link to="/article" className="text-decoration-none">Articles</Link>
        </a>
        <a className='list-group-item py-2'>
          <i className='bi bi-house fs-4 me-2'></i>
          <Link to="/factureAchat" style={"text-decoration: none"}>Facture d'achat</Link>
        </a>
        <a className='list-group-item py-2' onClick={toggleVenteLinks}>
          <i className='bi bi-house fs-4 me-2'></i>
          Vente
        </a>
        {showVenteLinks && (
          <>
            <a className='list-group-item py-2' style={{ paddingLeft: '2rem' }}>
              <i className='bi bi-house fs-4 me-2'></i>
              <Link to="/factureVente1" className="text-decoration-none">Vente 1</Link>
            </a>
            <a className='list-group-item py-2' style={{ paddingLeft: '2rem' }}>
              <i className='bi bi-house fs-4 me-2'></i>
              <Link to="/factureVente2" className="text-decoration-none">Vente 2</Link>
            </a>
            <a className='list-group-item py-2' style={{ paddingLeft: '2rem' }}>
              <i className='bi bi-house fs-4 me-2'></i>
              <Link to="/factureVente3" className="text-decoration-none">Vente 3</Link>
            </a>
          </>
        )}
      </div>
    </div>
  );
}

export default Sidebar;
